import React from "react";
import "./index.css";

export default function App() {
  return (
    <div className="min-h-screen bg-white flex flex-col items-center justify-center px-4 text-center">
      <h1 className="text-4xl font-bold mb-4">
        Welcome to <span className="fade-ai">SWAI</span>
      </h1>
      <p className="text-gray-600 mb-10 max-w-xl">
        Shop With AI — describe your project and budget, and we’ll build a full
        setup for you, from screens to accessories. All in one click.
      </p>
      <input
        type="text"
        placeholder="What do you need?"
        className="w-full max-w-md border-b border-gray-300 focus:outline-none focus:border-gray-500 text-center pb-2"
      />
    </div>
  );
}
